const defaultState = {
    info: "ghjf",
}

export const infoReducer = (state = defaultState, { type, payload }) => {
  switch (type) {
    case "CLEAR_INFO":
      return {...state, info};
    case "GET_INFO":
      return {...state, info: payload.toStrong()};
    default:
      return state;
  }
}
